IF(count(taxTransactions.id)  >= transactionthreshold, 'Yes','No') as transmet -- Transactions met? based on state threshold
INTO req, dollarsmet, transmet
from taxesState, taxTransactions -- Join taxesState to taxTransactions
where taxesState.id = taxTransactions.state_id 
and year =  year(now()) and taxesState.id = state_id  -- Based on year, $ and transactions
group by taxTransactions.state_id;

select dollarsmet;

if req is null then -- Required?
 set req = 'No';
end if;


IF ((dollarsmet = 'Yes' OR transmet = 'Yes') and req = 'Yes') THEN -- Must collect
 set req = 'Yes';
 else
  set req = 'No';
 end if;
 
IF req = 'Yes' THEN -- Based on above if statement, requiered?
  select taxRate into rate  from counties where id = county_id;
else
  set rate = 0;
end if;

select rate, req;

END$$

