INSERT INTO `diary` (`diaryId`, `userId`, `day`, `month`, `year`, `entry`, `date`) VALUES
(50, 68, 12, 3, 2020, '&nbsp;This is my first entry. <br /> <br /> Things have been pretty rough for a while. I closed my business down two years ago and my father passed away around the same time. I spent a good deal of time last year completing my bachelors degree but am still looking for a job. I had one in the fall but it didn&#039;t work out. Before that I spent 5 or 6 months working nights as a janitor. <br /> <br /> We&#039;re working to save the house which was in foreclosure. My parents are fronting us the money to buy it so there&#039;s some stress there as well. <br /> <br /> Ian has been in counseling for depression for a little over a year and things haven&#039;t really improved. <br /> <br /> Bron and I are in a good place I think. She just started a new job which I think will really improve her well being. Her old job was a nightmare and this new boss seems a lot like Dr. Agranov which I think is really good for her. <br /> <br /> I have a decent prospect for a job and should hear more soon. <br /> <br /> There&#039;s just too much to get everything into this first entry so I&#039;ll add <br /> things as I go and think of them.', '2020-03-12 00:00:00'),
(59, 68, 15, 3, 2020, 'I had big plans for the weekend which blew up for a couple reasons.  I wanted to take down tress and bushed in an area Bronwyn wanted cleared and I wanted to finish taking up the boards on the deck so I could begin replacing them. Alyssa asked us to watch the kids on Saturday so that certainly made a dent but then I had a chainsaw accident, taking a chunk out the my left leg.', '2020-03-15 00:00:00'),
(60, 68, 15, 3, 2020, 'Given the coronavirus scare I\'m thinking I should provide my phone number to my direct neighbors and tell them if they have to quarantine that I\'ll be available to get their groceries and prescriptions.', '2020-03-15 00:00:00'),
(61, 68, 15, 3, 2020, 'No additional work on the brush or deck. Bronwyn didn\'t want me working on it given my leg situation. Did some work on the application. Working on the post page and got the image add functionality going.  More work to get it right but moving in the right direction.\n\nTo date I\'ve completed the registration, login, forgot password, settings, profile edit pages, and continue to work on the home page. Right now the main menu on the home page is all set including info on messages, notifications, and impersonating managed users.', '2020-03-15 00:00:00'),
(62, 68, 15, 3, 2020, 'Almost forgot, the diary page is complete as well although there are tweaks I plan on adding at a later date.', '2020-03-15 00:00:00'),
(63, 68, 16, 3, 2020, 'Plan to quit smoking again tomorrow.  I\'d quite on February 6th (dad\'s birthday) for 21 days, smoked for two days, and then didn\'t smoke for another 6 before falling off the wagon for the last week or so.', '2020-03-16 00:00:00'),
(64, 68, 16, 3, 2020, 'Really hoping to hear something this week on the department of health position. Finger\'s crossed. Bob Fernandez, and Norm Zeyak both provided references to the boss and they both felt I was likely to be offered the position. Time will tell.', '2020-03-16 00:00:00'),
(65, 68, 15, 3, 2020, 'Plan for tomorrow is to finish up clearing the brush in the morning then focus on the work for West Virginia University.  If I hit a wall with that I\'ll continue on the posts section of the home page.  Either way I plan to work on that a little tomorrow even if it\'s in the evening.', '2020-03-15 00:00:00'),
(66, 68, 16, 3, 2020, 'I was offered the job at department of health and accepted it.  The only hang up is because of the virus I\'ll have to wait until April 20th to start. It is a relief after being out of work for so long.\n\nIt looks like Ian went from being off for a week to at least the end of the month a likely longer. They\'re sending him homework via email so hopefully it will all go well and he won\'t miss too much.\n\nLeg still looks nasty but it\'s getting better.', '2020-03-16 00:00:00'),
(67, 68, 16, 3, 2020, 'I didn\'t work on the yard, I felt Bron would be upset if I didn\'t give myself more time to heal. I did share my number with the neighbors and they seemed surprised and glad for the offer.', '2020-03-16 00:00:00'),
(68, 68, 16, 3, 2020, 'I basically vegged out all day and got nothing useful done. I\'ll try and do better tomorrow.', '2020-03-16 00:00:00'),
(69, 68, 22, 3, 2020, 'Been a crazy week with the coronavirus crack down.  Ian is out of school and as of Friday Bronwyn is out of work. Basically we both can\'t work or get paid because everything is shut down. There\'s no toilet paper at the supermarket because people are hoarding it which makes no sense.   Ian is starting on a new drug today so hopefully it will provide him some relief. I would hope with no school and him getting better sleep that might help as well. If it doesn\'t I don\'t know what we will be able to do for him.  He\'s talked about in patient treatment so I guess that would be the next step.  My leg\'s getting better but of course I took a chunk out of my finger rummaging around in my travel bag looking for hand sanitizer.  I pulled it across a razor that was in there and swiped a piece off my right ring finger.  Seems I injure myself every Saturday lately.', '2020-03-22 00:00:00'),
(70, 68, 22, 3, 2020, 'Falling behind on the house tasks. I was able to cut through the deck boards with the chainsaw yesterday but I still have to cut them off with the saws all.  Planned to do that today but it\'s a bit nippy out so I\'m taking the day off.  We had a remote session with Ian\'s counselor today. He\'s still pretty doom and gloom about how he\'s feeling. Wish I knew what we could do to help.', '2020-03-22 00:00:00'),
(71, 68, 23, 3, 2020, 'I was talking with Ian last night and saying the mass home schooling could turn into phase 1 of what I see as the future for public education. As we talked I said I should probably write this down so years from now my descendants would know what I was thinking and see if it came to pass.  Here\'s the plan.\n\nI don\'t believe mass education in schools is necessary.  Schools are little prisons used to house children while their parents are at work. It\'s more about child care than education.  I believe standard education should be available online so kids can either stay home or be sent to a real child care facility as necessary.  I also think what counts as education should be widened. Children learn so much that is not part of their formal education and they should get credit for it. Rather than a high school diploma I feel children should graduate with a \"portfolio\" of accomplishments, a portfolio they continue to build on all through their life as they learn new things.', '2020-03-23 00:00:00'),
(72, 68, 22, 3, 2020, 'Did a bunch of work on the WVU project this week so at least we can look forward to some money from that a month from now.', '2020-03-22 00:00:00'),
(73, 68, 24, 3, 2020, 'Another idea I had that I want to write down. With self driving cars on the rise someone needs to write a program that will allow people to make their cars available for rental like uber and lyft so their cars can be working while their owners are not in need of them.  This would significantly lessen the number of cars needed and drive down personal costs. It would be the next step in the \"gig\" economy.', '2020-03-24 00:00:00'),
(74, 68, 25, 3, 2020, 'Working on the WVU project. Covid (coronavirus) situation worsening here in the US.', '2020-03-25 00:00:00'),
(75, 68, 26, 3, 2020, 'Lots of back and forth with WVU on the data, making good progress. Covid continues to climb here and around the world. Ian is way behind on his homework, we got a notification from his guidance counselor today. They\'re winging it and don\'t seem like they have their ducks in a row.', '2020-03-26 00:00:00'),
(76, 68, 25, 3, 2020, 'Bron spoke to the doctor and he\'s planning on paying her as long as he can during the shutdown.  She stopped working last Friday. She\'s planning to go in on Friday to try and get some work done.', '2020-03-25 00:00:00'),
(77, 68, 28, 3, 2020, 'With all the time off Bron and I have been working on the house. She\'s been tearing up a storm in the kitchen and downstairs and I\'ve been working on the stuff in the loft, setting the shelves and moving things back upstairs. Basically I\'m unpacking all the stuff I packed in case we needed to move.  We got the house paperwork yesterday so we need to make plans to send it in. With the virus we\'re not having an in person closing, we\'re mailing it and it will all be done offline. I didn\'t manage to injure myself this week so it looks like I\'ve broken that streak thankfully. \n\nWork is going well on the WVU project, I haven\'t put any time into this project in a week or so since I\'ve been focused on that.  I think I should have that wrapped up next week and I\'ll likely still have a month or so off before the job starts so I\'ll get back on it then.', '2020-03-28 00:00:00'),
(78, 68, 29, 3, 2020, 'Ian\'s school has decided that students need to participate online during normal class hours.  I\'m a little disappointed about this as I really feel sleep is what may be driving Ian\'s depression. He\'s on a personal schedule where he stays up late and rises late but he\'s getting a good level of sleep. That\'s about to end unfortunately.', '2020-03-29 00:00:00'),
(79, 69, 29, 3, 2020, 'Test', '2020-03-29 00:00:00'),
(80, 68, 31, 3, 2020, 'Completed the paperwork for buying the house.  Still have to send it back to our lawyer but the check for the house was sent out.', '2020-03-31 00:00:00'),
(81, 68, 2, 4, 2020, 'Checked in with Heather. She spent a couple weeks with Jordan and has since moved to her mom\'s. She said they\'re not taking social distancing seriously so I offered that she could stay here.', '2020-04-02 00:00:00'),
(82, 68, 2, 4, 2020, 'Met with the PA who is prescribing medication to Ian. She recommended changing to lithium. We told her we\'d like to ride this out for a while given the new drug has only been being used for a week and a half and the world is upside down.', '2020-04-02 00:00:00'),
(83, 68, 4, 4, 2020, 'Alyssa stopped by a visit. While it was nice to see her I did grow concerned about possible spread of the virus. I told Bron the next time someone comes to visit and comes in the house the first thing we should do is ask them to wash their hands. \n\nI got most of the deck boards up, I plan to get the rest done tomorrow.', '2020-04-04 00:00:00'),
(84, 68, 5, 4, 2020, 'Off to a slow start today. Pretty wiped out from all the work I did yesterday. Bron did her usual grocery store run as she almost always does (bless her).', '2020-04-05 00:00:00'),
(85, 68, 6, 4, 2020, 'Bronwyn has been working on an afghan for about a week or so. She\'s currently cleaning up and going through her jewelry. I\'m still working on WVU and got an update from the department of health. They\'d like me to start on May 4th.  There\'s been nothing exciting going on since we\'re all self isolated.', '2020-04-06 00:00:00'),
(86, 68, 5, 4, 2020, 'Finished getting all the deck boards up. Next step, putting new ones down.', '2020-04-05 00:00:00'),
(88, 68, 7, 4, 2020, 'Ian and I went golfing today. We played 18 and it\'s the worst I\'ve golfed in probably 20 years but we had a great time.  We had a nice south korean older couple on the front nine but ran for drinks between rounds so finished up the back 9 by ourselves. My legs were sore from working ont he deck so I was pretty wiped out by the time we finished.', '2020-04-07 00:00:00'),
(89, 68, 8, 4, 2020, 'Sore legs today. Working on WVU still and making progress. Hoping to be done soon.', '2020-04-08 00:00:00'),
(90, 68, 8, 4, 2020, 'Started watching The OA tonight. Very weird show but there\'s not a lot on so I\'m dredging the barrel a bit.', '2020-04-08 00:00:00'),
(91, 68, 9, 4, 2020, 'Pretty much wrapped up the WVU work based on the approach I recommended.  They may still determine they want to go another route, at this point they owe me about $7,000.  It\'s an awful rainy and cloudy day today.', '2020-04-09 00:00:00'),
(92, 68, 9, 4, 2020, 'Ran out and got dog food, cashed my parents check, picked up cigarettes, and shipped Dylan\'s birthday present.', '2020-04-09 00:00:00'),
(93, 68, 9, 4, 2020, 'Filed taxes for 2017 and 2019 and got my paperwork into HRI for the new job. These were the items that have been hanging over my head so feeling a little better now that they\'re done.', '2020-04-09 00:00:00'),
(94, 68, 10, 4, 2020, 'I just got an email from Van Patten golf course that they closed as of yesterday based on a state mandate.  That means Ian and I golfed on the last day possible.  Kind of cool that we decided not to wait!', '2020-04-10 00:00:00'),
(95, 68, 10, 4, 2020, 'Feeling a real lack of energy today. Updated my plans to work outside Sunday instead of today since it will be nice out.  Seemed like a good plan but now I have nothing to do today so I\'m struggling to try and get my butt moving to work on at least some of my tasks today.  Not sure why I\'m so down. Bron\'s at work and Ian is asleep so maybe it\'s that I feel all alone.', '2020-04-10 00:00:00'),
(96, 68, 10, 4, 2020, 'I was able to get motivated enough to work on the driveway today.  When Bron got home we went to town on the bedroom and gave ti a deep clean.  The house is really starting to come together. There\'s still lots to do but it\'s looking so much better which is a bit uplifting in these confusing times.', '2020-04-10 00:00:00'),
(97, 68, 11, 4, 2020, 'I haven\'t done any work on this app for about a month.  Been busy working on WVI which I think is pretty much wrapped up. Spare time I\'ve been working on the house instead.  Have all day today to work on it but again not feeling highly motivated.  Not sure what my problem is lately.', '2020-04-11 00:00:00'),
(98, 68, 12, 4, 2020, 'Watched a ton of Peaky Blinders with Bron today. Didn\'t get much done around the house, like almost nothing at all. Didn\'t watch much news for once which was kind of a blessing. It\'s coronavirus 24/7 the last month and it\'s getting monotonous. Did a little work on the app yesterday, not much.', '2020-04-12 00:00:00'),
(99, 68, 13, 4, 2020, 'Called Dylan to wish him a happy birthday. Sounds like he\'s thinking about possibly leaving the air force after his six years are up.  He talked about either moving back home or out to Washington.  I told him he\'d have to make room for Ian since he really likes the idea of living out there.', '2020-04-13 00:00:00'),
(100, 68, 14, 4, 2020, 'Got nothing done at all. Sat around and watched the end of Peaky Blinders with Bron.', '2020-04-14 00:00:00'),
(101, 68, 15, 4, 2020, 'Meeting with WVU to discuss where we are. Need to tweak the process before presenting to the end user/champion.', '2020-04-15 00:00:00'),
(102, 68, 16, 4, 2020, 'Did some more work for WVU and trying to get my paperwork straightened out for the new job. Started watching Ozark with Bron (Peaky Blinders is finished). \n\nIan is finally focusing on getting his homework done since we had a serious talking to with him. i laid down the law and said no video games or youtube videos until it\'s all caught up.', '2020-04-16 00:00:00'),
(103, 68, 16, 4, 2020, 'Worked on the leftnav of the homepage on the app. Fixed it so that the accordions only show one open item at a time.', '2020-04-16 00:00:00'),
(104, 69, 17, 4, 2020, 'this is a test of the \'.  Chris\'s test', '2020-04-17 00:00:00'),
(105, 68, 18, 4, 2020, 'Frittered away the day watching Ozark with Bron. Don\'t recall getting much done around the house.', '2020-04-18 00:00:00'),
(106, 68, 17, 4, 2020, 'Did more paperwork for the new job and watched Ozark with Bron.', '2020-04-17 00:00:00'),
(107, 68, 19, 4, 2020, 'Got into an argument with Dave Nuzzi on facebook which lead to a call where we ironed out our differences. I explained to him he\'s an intelligent person and people less intelligent are rising up. \n\nFinished clearing the brush and started cutting up trees. Ian helped me stack up the wood from the deck and we cleaned up and put away the tarps.', '2020-04-19 00:00:00'),
(108, 68, 20, 4, 2020, 'Finished off Ozark, started on Bosch.  Got nothing useful done.  Need to get back to work on the app and do a little work on WVU.', '2020-04-20 00:00:00'),
(109, 68, 21, 4, 2020, 'Working in WVU this morning. Should would be nice if they\'d paid me for the last month.  At this point they owe me over $7000 and of course there\'s an issue because they\'ve frozen all \"new\" contracts.  For some reason they think I\'m new although my contract started at the beginning of the year.', '2020-04-21 00:00:00'),
(110, 68, 21, 4, 2020, 'Ian is till working to catch up on homework. We\'re going on a week now which makes me believe he was WAY behind. He failed German and Chemistry last semester which I just found out about last week. Poor kid, he has my disdain for school and inability to motivate himself to do the work. Dylan suffered from this too.  I have no idea how to help them since I could never get over it myself.  It all changed once I got out into the workforce. It did for Dylan too so hopefully Ian will follow that trend.', '2020-04-21 00:00:00'),
(111, 68, 24, 4, 2020, 'Ian hung out in our room as w went through pictures of Alaska and then he went through his pictures and we talked until almost 1am.  Haven\'t gotten much done. WVU is slowing payment so I asked them if they\'d consider allowing me to change my billing rate as compensation. that was a couple days ago and I haven\'t heard anything back.', '2020-04-24 00:00:00'),
(112, 68, 25, 4, 2020, 'Bron and I did a lot of work outside.  I cut up the remaining trees on the lawn which took two chainsaw blades to complete and she cleared some of the brush.  Ian and I got the bike stood up out of the quasi garage which allowed Bron to get it cleaned up.  There were a bunch of smaller things too like stacking wood and raking. All in all it was a very productive day.', '2020-04-25 00:00:00'),
(113, 68, 30, 4, 2020, 'Lots of work on WVU this week as well getting more done around the house. Bought a nail gun and compressors and scheduled to have the junk removed next week.  I have to figure out how to get the wood for the deck still.', '2020-04-30 00:00:00'),
(114, 68, 2, 5, 2020, 'We got a lot done in the yard today we got most of the area cleared and mowed that we cut down I got all the trees in the yard cut up and moved. Its starting to look pretty good. The junk guys are coming Monday to take that stuff which will definitely make things look even better. \n\nWeve started having dinner at the table which Ive been wanting for a while. Bron says she likes it too which is good. Ian is still struggling to catch up with homework.', '2020-05-02 00:00:00'),
(115, 68, 3, 5, 2020, 'Got all the trees off the front yard and the wood stacked today.  Picked up some tools that were around the yard and moved the wood from near the door to the front of the house.  things are starting to look a lot better outside.Bron\'s worked inside today.', '2020-05-03 00:00:00'),
(116, 68, 4, 5, 2020, 'Started at DOH as a project manager today. Had to run into the office despite the lockdown to get my computer set up. Had some calls and doing lots of homework.', '2020-05-04 00:00:00'),
(117, 68, 4, 5, 2020, 'Had a long call with Celeste (my report) which made me miss the Jdog people who couldn\'t find the house.  They\'re coming back on Thursday.  It will be nice to be rid of all the junk.', '2020-05-04 00:00:00'),
(118, 68, 4, 5, 2020, 'Chuck is going to jump in and help with some of the WVU Work', '2020-05-04 00:00:00'),
(119, 68, 4, 5, 2020, 'Bron and I watched the Swedish Girl with Dragon Tattoo. It was better than the Hollywood version.', '2020-05-04 00:00:00'),
(120, 68, 5, 5, 2020, 'Bron and I watched the second in the Girl with the Dragon Tattoo movies. Got more work done for DOH. Struggling to get online but working around it. Met with the project champion, she seems sharp.', '2020-05-05 00:00:00'),
(121, 68, 6, 5, 2020, 'DOH is worried I\'m going to fast so I basically took most the afternoon off to slow my progress.  We ran to Laskey Lumber (twice, they were closed the first time) and picked up wood for the deck.', '2020-05-06 00:00:00'),
(122, 68, 9, 5, 2020, 'Got the railings replaced on the deck with Ian\'s help. Took the faucet apart but need to replace it as fixing seems like it would be a hassle.  Stacked all the left over deck wood against the house.', '2020-05-09 00:00:00'),
(123, 68, 10, 5, 2020, 'Worked on WVU a bit', '2020-05-10 00:00:00'),
(124, 68, 12, 5, 2020, 'Pretty busy trying to balance DOH, WVU work as well as work on the app. Haven\'t been doing a lot of diary entries because of this. We did meet with Johnathan within the last week as well as Kim. They upped Ian\'s dosage which was what he wanted.  He still feels it\'s below where it should be.', '2020-05-12 00:00:00'),
(125, 68, 11, 5, 2020, 'I posted a job on upwork to get help with posting messages/images. I just feel it\'s pretty complicated and could use a leg up.', '2020-05-11 00:00:00'),
(126, 68, 11, 5, 2020, 'fixed the trim on the doors, the cat wall trim, and started cleaning the inside of the windows.', '2020-05-11 00:00:00'),
(127, 68, 11, 5, 2020, 'CatWALK, not cat wall', '2020-05-11 00:00:00'),
(128, 68, 14, 5, 2020, 'Cut up some small stumps where we cleared the brush, spread some seed and weedkiller.  Bron cooked an amazing apple pie for Alyssa\'s birthday.  I told her I\'ve never seen such a perfect looking home made pie.', '2020-05-14 00:00:00'),
(129, 68, 13, 5, 2020, 'Ian\'s new monitor came. I\'d given him one from work that had a bullseye in it and it fell off his desk while he was moving things. He was so distressed we went right out and ordered him a new one.', '2020-05-13 00:00:00'),
(130, 68, 14, 5, 2020, 'Bron is headed back to work on Monday. It\'s going to be weird not having her around all the time. We\'ve actually gotten along really well through all this craziness.  I\'m going to miss it I think.', '2020-05-14 00:00:00'),
(131, 68, 14, 5, 2020, 'Completed the new create award stored procedure for WVU. It takes 3 minutes to run which is too long but there\'s nothing I can do about that. If they wanted to set the system up using their method it would take over 1000 hours to run.', '2020-05-14 00:00:00'),
(132, 68, 16, 5, 2020, 'Started cutting up the big oak and stacking it under the deck. Ran to the hardware store to get my chainsaw blades.', '2020-05-16 00:00:00'),
(133, 68, 17, 5, 2020, 'Finished stacking up the oak with Ian\'s help. Cut up the little tree that was leaning on the deck and stacked it as well. Really cleared out the space next to the deck. Ran to lowes and got a garbage can (plastic) to put the wood from the metal can into. Started burning the stuff in the burn pile in the garbage can.  Raked up a bunch.', '2020-05-17 00:00:00'),
(134, 68, 18, 5, 2020, 'The deck wood came. Ian helped me lay it out on the deck. Going to have to make a lot of cuts as the joists aren\'t al where they should be unfortunately. Adds a lot of work. Still burning up the waste. WVU call delayed because we ran into some more issues. Got the hanging issues for the update award stored procedure addressed so we\'re in pretty good shape.', '2020-05-18 00:00:00'),
(135, 68, 18, 5, 2020, 'Bron went back to work full time today.', '2020-05-18 00:00:00'),
(136, 68, 19, 5, 2020, 'Picked up the radial arm saw from Larry today to use on the deck.  DOH is getting a little complicated. Celeste (my direct report) is highly opinionated and sent me a fairly unprofessional email today.  I decided not to respond since she mentioned following up with a call.  I\'m struggling not to tell her how I felt about it. She thinks she knows more about running this project than I do it seems.', '2020-05-19 00:00:00'),
(137, 68, 16, 5, 2020, 'Got lots of bird food for the feeders', '2020-05-16 00:00:00'),
(138, 68, 17, 5, 2020, 'Got a new hummingbird feeder and food.', '2020-05-17 00:00:00'),
(139, 68, 19, 5, 2020, 'Cut my own hair again today using the trimmer.', '2020-05-19 00:00:00'),
(140, 68, 17, 5, 2020, 'Alyssa came by and picked up Ian\'s old (not really that old) bed.  I helped her take it apart andload it in the truck.  One more thing out of the house!', '2020-05-17 00:00:00'),
(141, 68, 7, 5, 2020, 'JDog came and picked up the junk! two overfull \"bagsters\" of junk gone. With all the work we did on the lawn and getting rid of that stuff it\'s starting to look pretty respectable around here.', '2020-05-07 00:00:00'),
(142, 68, 20, 5, 2020, 'Still burning... almost done.  Fixed some WVU items and working on DOH plan of attack.', '2020-05-20 00:00:00'),
(143, 68, 20, 5, 2020, 'Ian\'s returning stuff to school.  They had to make a special appointment to do it.', '2020-05-20 00:00:00'),
(144, 68, 20, 5, 2020, 'Did more work on the deck. Got pretty much up to the bird feeder done. Turns out I was offline so I\'m trying to correct that the best I can.', '2020-05-20 00:00:00'),
(145, 68, 21, 5, 2020, 'WVU on hold until Tuesday. They\'re doing work on the servers and Monday is a holiday.', '2020-05-21 00:00:00'),
(146, 68, 21, 5, 2020, 'Engaged someone on UpWork to help with the posting of messages/images/videos. It was a little over my head.', '2020-05-21 00:00:00'),
(147, 68, 21, 5, 2020, 'Plan to use that code in the categories sections as well for posting stories, education. work, etc.', '2020-05-21 00:00:00'),
(148, 68, 21, 5, 2020, 'I\'ve got a decent grip on the fear of death flashes i\'ve been having. It\'s still not great but not as debilitating as it was a month or so ago. I\'ve gone back to the mantras I had when I was younger to put it out of my mind as best I can.', '2020-05-21 00:00:00'),
(149, 68, 21, 5, 2020, 'Been spraying the windows/doors and siding to try and get a handle on the carpenter bee situation. It\'s a losing battle for sure.', '2020-05-21 00:00:00'),
(150, 68, 20, 5, 2020, 'Read a good article on how to write dialogue.  I\'m still thinking about writing my stories when I have the time.', '2020-05-20 00:00:00'),
(151, 68, 21, 5, 2020, 'Still no hummingbirds :(', '2020-05-21 00:00:00'),
(152, 68, 21, 5, 2020, 'Did see a red breasted grosbeak at the feeder earlier this week which was kind of cool!', '2020-05-21 00:00:00'),
(153, 68, 21, 5, 2020, 'Began working on losing some weight.  I shot up to 165 pounds which I\'m not happy about.  I was in the low 150\'s not so long ago.  I\'ve cut back on my ice cream intake, was eating it every night for a snack.  I\'ve also tried adding some water in place of Pepsi.  I\'m currently down to 162.2 so a little progress.', '2020-05-21 00:00:00'),
(154, 68, 21, 5, 2020, 'Was hoping to finish the west side of the deck today but I got my left middle finger with the nail gun so that plan didn\'t work out.  Almost done, another couple of hours to wrap it up', '2020-05-21 00:00:00'),
(155, 68, 22, 5, 2020, 'Midnight drive to the ER. Turns out I didn\'t hit the bone. Did I mention the nail went a little more than half an inch into my finger?  I went because the swelling was getting bad and worried I\'d really messed something up. Turns out I didn\'t so it was pretty much a waste fo time. Better to be safe than sorry I suppose.', '2020-05-22 00:00:00'),
(156, 68, 22, 5, 2020, 'Have to remember to finish entering in counties and taxes for memoreebook.  It\'s drudge work but needs to get done.', '2020-05-22 00:00:00'),
(157, 68, 22, 5, 2020, 'Parents came by for a tour of our progress around the yard.', '2020-05-22 00:00:00'),
(158, 68, 22, 5, 2020, 'Got the faucet installed in our bathroom.', '2020-05-22 00:00:00'),
(159, 68, 22, 5, 2020, 'Trying to figure out a good time to talk to Bronwyn about quitting smoking. It\'s too tough to do alone with cigarettes in the house.  I quit for about a month back in February so I think I can do it with a little help.', '2020-05-22 00:00:00'),
(160, 68, 22, 5, 2020, 'Finished burning up all the junk in front of the house.', '2020-05-22 00:00:00'),
(161, 68, 22, 5, 2020, 'Forgot to mention they gave me a tetanus shot last night.', '2020-05-22 00:00:00'),
(162, 68, 23, 5, 2020, 'Finished the west side of the deck. Worked on cleaning screens and windows', '2020-05-23 00:00:00'),
(163, 68, 24, 5, 2020, 'Finished the south side of the deck.', '2020-05-24 00:00:00'),
(164, 68, 25, 5, 2020, 'Removed the cables and fasteners from the west side of the house. Took down the satellite dish with Ian\'s help. Finishing cleaning the insides of the windows and putting in the screens. Washed the outside of the windows.  Parents came over in the morning for a visit.', '2020-05-25 00:00:00'),
(165, 68, 26, 5, 2020, '162.6 lbs today.  No real progress.', '2020-05-26 00:00:00'),
(166, 68, 26, 5, 2020, 'Bronwyn and I both Ian is doing better. Lord knows if he agrees but externally he seems beter.', '2020-05-26 00:00:00'),
(167, 68, 25, 5, 2020, 'Started watching Outlander.  We\'re starved for entertainment.', '2020-05-25 00:00:00'),
(168, 68, 27, 5, 2020, 'Interviewing candidates for the final position at DOH.', '2020-05-27 00:00:00'),
(169, 68, 27, 5, 2020, 'Picked up remaining wood needed from Laskey\'s as well as the railing tops from Lowes. Talked to Ian about doing a little work for pay as he needs the money.', '2020-05-27 00:00:00'),
(170, 68, 28, 5, 2020, 'Finished up the railings.  Have to complete the pickets (cut them up and nail them in) and the tops and I\'ll be all done with the deck finally!', '2020-05-28 00:00:00'),
(171, 68, 28, 5, 2020, 'Third interview today. None of the candidates have wowed me.', '2020-05-28 00:00:00'),
(172, 68, 28, 5, 2020, 'Last interview Monday, three people dropped out.', '2020-05-28 00:00:00'),
(173, 68, 27, 5, 2020, 'Ian\'s bank account is in the hole. He went on a tirade about how banks are screwing people during the pandemic like it\'s a surprise.  I offered him some work and we ran ti subway to grab dinner.', '2020-05-27 00:00:00'),
(174, 68, 28, 5, 2020, 'Ran to Wendy\'s with Ian for dinner.', '2020-05-28 00:00:00'),
(175, 68, 29, 5, 2020, 'Lots of meetings today. Starting working on an updated budget for the project.', '2020-05-29 00:00:00'),
(176, 68, 30, 5, 2020, 'Emptied the hut out and moved it away from the house. Reorganized and now there\'s lots of room and it looks a LOT better.  Finished the pickets and the top railings. Repaired the benches and drilled the hole for the bird feeder.  I have to trim a little off the top rail near the TV window so it will open and then the deck will be truly DONE!', '2020-05-30 00:00:00'),
(177, 68, 30, 5, 2020, 'Ran Brons car up to Alyssa\'s house.  My car isn\'t charing and it died on the way home.  A nice young mand stopped and gave us a jump and we were able to get home safely.', '2020-05-30 00:00:00'),
(178, 68, 31, 5, 2020, 'Taking a break today. Moved the garbage cans and dumped the ash in one of the holes in the lawn. Seeded the lawn and set up the sprinkler. Resolved the latest issue with the WVU stored procedures and sent the draft budget to Stephanie for the DOH project.', '2020-05-31 00:00:00'),
(179, 68, 2, 6, 2020, 'Went into the office for the first time since my first day.  A LOT of people not wearing masks in the concourse and two people walking in public spaces without masks on my floor.  People just don\'t seem to get it.\n\nMet with the PA and encouraged her to up Ian\'s dosage. He seems a little better to us even though he doesn\'t think it\'s helping.  If he still feels the same way in three weeks I guess we will try and figure out the next steps.', '2020-06-02 00:00:00'),
(180, 68, 1, 6, 2020, 'Ian and I ran up to McDonalds on the bike to grab dinner.', '2020-06-01 00:00:00'),
(181, 68, 3, 6, 2020, 'The deck furniture came, albeit a little late. We dropped the radial arm saw back off.', '2020-06-03 00:00:00'),
(182, 68, 2, 6, 2020, 'Went grocery shopping with Bron.', '2020-06-02 00:00:00'),
(183, 68, 3, 6, 2020, 'Got dog food too.', '2020-06-03 00:00:00'),
(184, 68, 4, 6, 2020, 'Got the new table and chairs put together (deck furniture).  Ian went to a party at Mirandas.', '2020-06-04 00:00:00'),
(185, 68, 4, 6, 2020, 'Still working on the post code with the consultant. It\'s looking better but not quite ready.', '2020-06-04 00:00:00'),
(186, 68, 6, 6, 2020, 'Spent the morning and early afternoon car shopping.', '2020-06-06 00:00:00'),
(187, 68, 7, 6, 2020, 'Cut up the rest of the big oak and started on the trees farther out.', '2020-06-07 00:00:00'),
(188, 68, 6, 6, 2020, 'We all had chicken rolls for dinner on the deck on the new table.', '2020-06-06 00:00:00'),
(189, 68, 7, 6, 2020, 'Found I\'d missed four bolts on the new table so took care of that. Cut some stairs into the hill next to the deck to make climbing up a bit easier.   Filled on one of the yard holes completely with the dirt from the stairs.', '2020-06-07 00:00:00'),
(190, 68, 6, 6, 2020, 'First fireflies of the season', '2020-06-06 00:00:00'),
(191, 68, 10, 6, 2020, 'Not a lot exciting going on right now. Planning to fix the BMW, ordered an alternator.  Bron made an interesting dish for dinner, now sure what it was but pretty good. Ate on the deck :)\n\nIan is well into his summer schedule so up odd hours. \n\nWe\'re finishing up binge watching Outlander. Pretty decent show.', '2020-06-10 00:00:00'),
(192, 68, 12, 6, 2020, 'Ian went to the grandparents for the first time since the pandemic started.  They dropped off their power washer for us.', '2020-06-12 00:00:00'),
(193, 68, 13, 6, 2020, 'Started power washing the house. The power washer failed after about half an hour but the parts done look great.', '2020-06-13 00:00:00'),
(194, 68, 14, 6, 2020, 'Power washed the entire deck and some of the house. Spent about 8 hours working on it. IT\'s looking a lot better.', '2020-06-14 00:00:00'),
(195, 68, 15, 6, 2020, 'Spent another 8 plus hours on the house. Had to move up to a ladder as all the low spots were done. Making some real progress. Another day or so and the BIG ladder and the house should be done.  Not sure how I\'m going to reach the highest spots yet and a little worried being that high up.', '2020-06-15 00:00:00'),
(196, 68, 14, 6, 2020, 'Finished watching outlander... maybe I can get some work done now ;)', '2020-06-14 00:00:00'),
(197, 68, 11, 6, 2020, 'Met with Vikram about paramountsoft\'s interest in Fasttrak\n\nStarted working to get Fasttrak bacc up and running.', '2020-06-11 00:00:00'),
(198, 68, 12, 6, 2020, 'Engaged Shyam to help getting Fasttrak working again. The apps and databases are set up and the app loads but isn\'t working quite yet.', '2020-06-12 00:00:00'),
(199, 68, 20, 6, 2020, 'Finished power washing the west and north sides of the house.  Looks pretty good!', '2020-06-20 00:00:00'),
(200, 68, 21, 6, 2020, 'Parents and Heather came over for father\'s day.  Had shish-kabobs on the deck. Had a nice call with Dylan later in the evening.', '2020-06-21 00:00:00'),
(201, 68, 24, 6, 2020, 'VTExperts can\'t figure out how to get into my server to fix the issues with FastTrak. It\'s been a long process getting them to take a look at it.  The developer has made minimal progress as well.  I\'ve done nothing on this site in quite some time.', '2020-06-24 00:00:00'),
(202, 68, 24, 6, 2020, 'Dad died 2 years ago today.  At some point maybe I won\'t think about him every single day.  I feel like I should sit with Laura and Patty and record their stories about him and their parents before all of it is lost to time.', '2020-06-24 00:00:00'),
(203, 68, 27, 6, 2020, 'Finished power washing the east side of the house today.', '2020-06-27 00:00:00'),
(204, 68, 28, 6, 2020, 'The South side of the house is done (power washed).  The entire house is done, I\'d guess it looks about 30 hours to complete and took a few years off my life being up on that ladder.', '2020-06-28 00:00:00'),
(205, 68, 27, 6, 2020, '159 lbs today.', '2020-06-27 00:00:00'),
(206, 68, 28, 6, 2020, 'VTExperts are still working to get FastTrak running again.  They encrypted their code to work with php 5.5 and the site is now on 7.2 which is causing the issue i believe.  They\'ve tried to fix it a couple times but no improvement.  I want to get this running in case the company that reached out to me wants to market or buy it.', '2020-06-28 00:00:00'),
(207, 68, 28, 6, 2020, 'I reached out to the other contractor to help more with the posts section of the home page.  I want him to work out the tag friends functionality.  When I have both pieces of code I want to use them in the categories sections of the website so the investment is worth it.', '2020-06-28 00:00:00'),
(208, 68, 2, 7, 2020, 'We were planning to take Ian on a trip through British Columbia and to Alaska this summer.  The Canadian border is closed and there\'s little hope they will open it.  I had a backup plan to go to Ireland and now with EU is not letting Americans in so that\'s off the table as well.  Bron wanted to take just a week and go visit Dylan and Sarah but now we would have to quarantine upon return and she can\'t take 3 weeks off.  Covid is really wreaking havok on our plans.', '2020-07-02 00:00:00'),
(209, 68, 4, 7, 2020, 'We went up to my parents place in Babcock lake for the 4th. Just lazed around.  Heather decided to go with friends to lake George instead so it was just the five of us. We didn\'t do the traditional fireworks run to New Hampshire and so Ian and I weren\'t too into the fireworks which was disappointing to my mother.', '2020-07-04 00:00:00'),
(210, 68, 5, 7, 2020, 'Did pretty much nothing except to cut down a limb the squirrels were using to get at the bird feeder.', '2020-07-05 00:00:00'),
(211, 68, 5, 7, 2020, 'Finished up watching the Newsroom (again).', '2020-07-05 00:00:00'),
(212, 68, 6, 7, 2020, 'Started (rewatching) Hanna with Bronwyn.  We all watched the latest episode of Yellowstone together.  We\'ve been doing that every week.', '2020-07-06 00:00:00'),
(213, 68, 8, 7, 2020, 'The Covid situation is getting worse.  About a thousand people died yesterday and people are still arguing about wearing masks.  It\'s pretty sad.', '2020-07-08 00:00:00'),
(214, 68, 9, 7, 2020, 'Spoke with Bruce Brownell today.  I\'d been talking with Mark Bomba about solar panel and he knew Bruce as well. He said Bruce had encouraged him to take up his business because his son has his own in hot tubs.  I asked Bruce if he was still looking for someone to take up that role and he said yes.  I need to talk to Bron because this would be a major decision.  I\'d really like to be doing something to make peoples lives better and this seems like a good fit. Bruce says there isn\'t a lot of money in it but that\'s never really been what drives me.  If it\'s a living I think that would be enough.  I\'d like to see if Ian was interested in it as well. Gotta hand it off to someone at some point.', '2020-07-09 00:00:00'),
(215, 68, 8, 7, 2020, '890 died today.', '2020-07-08 00:00:00'),
(216, 68, 11, 7, 2020, 'Spoke with Bruce Brownell today.  Set up to meet with him on Wednesday in the evening. Tolkd him about my schedule and he said he\'s in no rush.', '2020-07-11 00:00:00'),
(217, 68, 9, 7, 2020, 'Spoke with Bron about Bruce and while she didn\'t seem thrilled she wasn\'t opposed ot me working with him.', '2020-07-09 00:00:00'),
(218, 68, 11, 7, 2020, 'Cut up some more trees today. It was wicked hot so didn\'t make a lot of progress but made a dent.', '2020-07-11 00:00:00'),
(219, 68, 12, 7, 2020, 'Cut up some more trees, less than yesterday as I ran out of sharp blades.  I stacked all the wood that\'s been cut in piles which was an effort. Bron and Ian and I spent some nice time on the deck in the evening. Bron mowed the lawn again, she\'s taken this on as her task which doesn\'t seem fair despite all the yard work I\'m doing.', '2020-07-12 00:00:00'),
(220, 68, 12, 7, 2020, 'We went to Lowes and bought more birdseed and a new hummingbird feeder.  The last one was nice to look at but attracted no hummingbirds. Hopefully the new one will be more attractive to them.', '2020-07-12 00:00:00'),
(221, 68, 13, 7, 2020, 'Need a new bird feeder.  The squirrel wrecked our current one when he got to it.  It now sounds like we live in a casino as the seed pours out onto the metal squirrel guard.', '2020-07-13 00:00:00'),
(222, 68, 14, 7, 2020, 'It\'s been a couple years since Bronwyn and I had sex. It\'s been a total of twice in the last three years. I\'ve shown her I\'m interested but she seems to have any. For my part I feel like she\'s not attracted to me so I don\'t pursue it. I\'m also older and to be honest not as interested as I once was. I feel though like it\'s still an elephant in the room which we don\'t talk about. That\'s the part I truly worry about.', '2020-07-14 00:00:00'),
(223, 68, 14, 7, 2020, 'I ordered new filters and a new motorcycle jacket which should come in the next couple days.  One of the benefits of having a job again.', '2020-07-14 00:00:00'),
(224, 68, 15, 7, 2020, 'I went with Bron to the Subaru dealership to do some car shopping.  She picked out a car, a mid level model but it wasn\'t available in red. She\'d said she liked the red but was going to compromise for a grey one.  I told her she puts 10k miles a year on cars and these case last over 200k miles so it could well be the last car she owns.  I offered to give her the $2400 more the red one on the lot would cost.', '2020-07-15 00:00:00'),
(225, 68, 18, 7, 2020, 'Picked up Bron\'s new car today.', '2020-07-18 00:00:00'),
(226, 68, 22, 7, 2020, 'The site\'s been down since mid last week so no many entries.', '2020-07-22 00:00:00'),
(227, 68, 15, 7, 2020, 'Ian and I met for an hour with Bruce Brownell.  He walked us through some of his history but couldn\'t spend a lot of time as he\'s caring for his wife who broke her arm and pelvis.  He gave us some paperwork to review before our next meeting.', '2020-07-15 00:00:00'),
(228, 68, 19, 7, 2020, 'Took the weekend off from working around the house again.  Haven\'t gotten much done in the last few weeks.', '2020-07-19 00:00:00'),
(229, 68, 22, 7, 2020, '158.9 lbs this morning.', '2020-07-22 00:00:00'),
(230, 68, 23, 7, 2020, '158.6', '2020-07-23 00:00:00'),
(231, 68, 23, 7, 2020, 'Spoke with Mark Bomba and learned the grid doesn\'t charge you to send and receive energy you generated so there\'s no need for battery backup to save money.  The grid acts as your battery which is excellent news.', '2020-07-23 00:00:00'),
(232, 68, 24, 7, 2020, 'Still 158 :)', '2020-07-24 00:00:00'),
(233, 68, 25, 7, 2020, 'Started to cut down trees.  First tree the chainsaw got stuck in the tree and I had to ax it out. It took an hour! Both of my forearms hurt and I was wiped out and it was only 11 o\'clock.', '2020-07-25 00:00:00'),
(234, 68, 25, 7, 2020, 'Cut down another 8 trees or so. I\'m in the right general area for the western exposure but need to push back a little farther.', '2020-07-25 00:00:00'),
(235, 68, 27, 7, 2020, 'It\'s been 31 days from my last entry.  Ian and I were in a motorcycle accident at the end of the driveway.  We were struck by a car who I am certain was speeding excessively. Ian has alarge cur on his left heel a broken thumb, and a compression fracture in his neck (C7).  My left leg was broken (Tib/fib fracture), two aneurisms, and a hematoma.  We both had some road rash. I was in the hospital until Friday because they put a titanium rod in my leg and a couple screws in my ankle. Ian went home on Wednesday. I remember very little from the entire day.', '2020-07-27 00:00:00'),
(236, 68, 29, 7, 2020, 'Surgery today.  I was worried about the anesthesia, he gave me shot that wiped me out.  The next thing I remember was waking up in recovery. I was very happy about that.', '2020-07-29 00:00:00'),
(237, 68, 31, 7, 2020, 'Finally went home.', '2020-07-31 00:00:00'),
(238, 68, 22, 8, 2020, 'I just haven\'t had a lot to report over the month. It\'s been difficult and painful and the days just blur into each other.', '2020-08-22 00:00:00'),
(239, 68, 23, 8, 2020, 'We celebrated Larry\'s birthday today at the house.', '2020-08-23 00:00:00'),
(240, 68, 28, 7, 2020, 'Dylan came up to help take care of us.  He will be here for a little over two weeks.', '2020-07-28 00:00:00'),
(241, 68, 14, 8, 2020, 'Dylan headed home this morning. We said goodbye and he was shifting things around in his car, when he was done he ran back over to me to give me another hug and made me cry.  He\'s such a good kid!', '2020-08-14 00:00:00'),
(242, 68, 18, 8, 2020, 'Ortho appointment.  I can\'t put weight on my foot for another 3 weeks.', '2020-08-18 00:00:00'),
(243, 68, 20, 8, 2020, 'Neuro appointment. Turns out my skull was not fractured after all.  The said the blood is all gone from around my brain and cleared me to go back to work.', '2020-08-20 00:00:00'),
(244, 68, 24, 8, 2020, 'Went back to work today (finally).', '2020-08-24 00:00:00'),
(245, 68, 26, 8, 2020, 'Bron stayed at work four hours late to get caught up.  I was pretty upset about it and I don\'t know why.', '2020-08-26 00:00:00'),
(246, 68, 3, 9, 2020, 'Haven\'t been posting much as things are kind of dull with the injury and all.  Thought my nest appointment was Monday but it\'s a week from Monday which is a little disappointing. I was hoping to get approval to start trying to walk sooner than later.', '2020-09-03 00:00:00'),
(247, 68, 26, 9, 2020, 'Haven\'t had a lot to post since I\'ve pretty much been stuck in bed.  Still on the mend from the accident. Can\'t walk yet.\n\nStarted working on the app again. Updating the post and next up displaying posts. Looking into a scheduling tool as well. There\'s a ton to still do, not sure I\'ll ever finish but it\'s a distraction which I\'m in need of at the moment.\n\nThe DOH work is coming along. I stood up the database and application and launched the first chunk of code for logging in, etc. Lots of work to do there too.', '2020-09-26 00:00:00'),
(249, 68, 26, 9, 2020, 'Spent the day watching season 7 of the mentalist with Bron. We\'ve been working our way though it over the last few weeks.', '2020-09-26 00:00:00'),
(250, 68, 22, 10, 2020, 'Been really falling behind on my entries lately. Sorry.  I\'ve had a couple meetings with Bruce about Adirondack Alternate Energy.  I\'ve created a website for it and done a lot of homework on what could be added to the process and finding sources to support claims. I\'ve made a little headway on the Memoreebook app (this system) but not a lot to report there. No big changes at work. Held about 20 meetings with operators to review my mockups and they\'ve had some great input.  I started walking on Monday in earnest, no more crutches.  The pain is getting better, I\'m pretty much hobbling around but it gets a little better everyday. Everyone\'s else is doing about the same so nothing to report.', '2020-10-22 00:00:00'),
(251, 68, 1, 11, 2020, '2 days from the the election. I\'m predicting a blue wave for the democrats and I\'m hopeful if they take the white house and senate that they finally pass some progressive laws.\n\nThese are the things i\'m hopeful will happen.\n\nStatehood for DC,  Puerto Rico, Guam, Northern Mariana, Us Virgin Islands (increases tax revenues)\nOffer state hood to any country who wants it, expand the United States, add senators and congress people (increases tax revenues)\nIllegal Aliens, offer citizenship for $50,000 paid over time as a tax deduction (3%), $750,000,000 in income (increases tax revenue)\nSignificantly increase immigration (increases tax revenues)\n$15 an hour minimum wage nationwide (increases tax revenues)\nReparations. Offer Medicare for all the all African Americans, Native Americans (help heal the country)\nExpand medicare for al to ALL Americans some time after (will make the transition easier if some people are already getting it)\nTerm limits. Limit service to 12 year with exception of President / Vice President (would be hugely popular)\nCampaign finance reform. Limit the amount that can be given to candidates to x dollars (drive down outside influence)\nCampaign finance reform. Eliminate political advertising by anyone but candidates (eliminates super pacs and dark money)\nSupreme Court, expand to 13 seats. The last expansion matched the number of district courts which was nine, there are now 13 district courts.  The would continue on past president and discourage additional court packing in the future unless there is an increase in districts.\nTax credit for voting, penalty for not voting. (Drive up voting, benefits Democrats)\nRoll tax code back near levels of the 1950s (increases tax revenues)\nEliminate the filibuster (drive through progressive agenda)\nLevy federal fines on police department for killing anyone. (Justice reform)\nEliminate qualified immunity for police officers, limit to non lethal actions \nAutomatic voter registration on any government interaction.', '2020-11-01 00:00:00'),
(252, 68, 10, 11, 2020, 'We fist learned of electricity 100 years ago, we\'ve learned nothing since. It\'s all around us all the time and yet we\'ve done nothing.\n\nWe learned about gravity 360 years ago and have learned nothing since. It\'s al around us and yet we still don\'t understand it.  It\'s not what we think it is, it\'s just inertia.', '2020-11-10 00:00:00'),
(253, 100, 23, 11, 2020, 'I read that using a hyperbaric chamber extends the length of telomeres and possibly life expectancy. I\'m blessed with good health but would like to live long enough for us to make real progress on life extension. I\'m considering this as a possibility. Of course this won\'t resolve my likely coming down with Alzheimers as my father, his father, and his father did.', '2020-11-23 00:00:00');
INSERT INTO `diary` (`diaryId`, `userId`, `day`, `month`, `year`, `entry`, `date`) VALUES
(254, 68, 23, 11, 2020, 'read that using a hyperbaric chamber extends the length of telomeres and possibly life expectancy. I\'m blessed with good health but would like to live long enough for us to make real progress on life extension. I\'m considering this as a possibility. Of course this won\'t resolve my likely coming down with Alzheimers as my father, his father, and his father did.', '2020-11-23 00:00:00'),
(255, 68, 4, 11, 2020, 'The blue wave didn\'t happen despite the polls.', '2020-11-04 00:00:00'),
(256, 68, 5, 12, 2020, 'Testing?', '2020-12-05 00:00:00'),
(257, 68, 5, 12, 2020, 'So the diary wasn\'t working and it looks like it was a login issue as it\'s working now.', '2020-12-05 00:00:00'),
(258, 68, 30, 11, 2020, 'Flew to Costa Rica today to get dental work done.', '2020-11-30 00:00:00'),
(259, 68, 1, 12, 2020, 'Met with the dentist.  He changed my mind about removing my top teeth. He said he can fix all my teeth for a little more than what doing what I wanted to do on the top would cost.  Spent the morning having him grind down all my remaining teeth. The put two temporary one piece caps on both the top and bottom.  My gums really hurt.', '2020-12-01 00:00:00'),
(260, 68, 2, 12, 2020, 'Went back to the dentists for 9 root canals.  Fun morning.  When they were done they had to extract one tooth.  Also fun. Later in the afternoon they put on two more one piece crowns.  Gums hurt even more than yesterday.  Teeth look good.', '2020-12-02 00:00:00'),
(261, 68, 3, 12, 2020, 'Flying home.  Left my laptop on the first flight but was able to recover it after walking (fun with my leg) back to the first terminal and back to the second. Lost my license.  Ordered a new one online while at the airport.  Got home a little after 8pm.  Glad it\'s over for now. I\'ll owe them about $7000 to finish the work and they want me back as soon as possible so that\'s going to be a challenge.', '2020-12-03 00:00:00'),
(262, 68, 12, 12, 2020, 'Working in earnest on this site now.  I\'ve been slacking for far too long. I\'ve got a couple tasks posted to upwork. One to do the events and another for the family tree. I\'m working on profile stuff and messages at the moment.\n\nI\'ve been bad about putting in diary entries for the last few months.  I kind of forget about it to be honest. I think after the accident things took a weird turn for me so I\'m going to blame it on that.  I\'m still limping around.\n\nI\'m supposed to start going back to the office on the 23rd. One day each pay period so nothing awful.', '2020-12-12 00:00:00'),
(263, 68, 30, 11, 2020, 'Actually it was yesterday :)', '2020-11-30 00:00:00'),
(264, 68, 2, 12, 2020, 'Flew home.  Left my laptop on the Costa Rice flight but was able to go back for it thankfully. Left my license with customs so had to order a new one.', '2020-12-02 00:00:00'),
(265, 68, 3, 12, 2020, 'Yup, I posted most of this on the correct day so this looks a little duplicative. Sorry.', '2020-12-03 00:00:00'),
(266, 68, 18, 12, 2020, 'We got 3 feet of snow yesterday.  Our new plow guy didn\'t plow early so got stuck in the driveway.  Bron needed to borrow a car from my parents and walk through all the snow to get to work. They say they are coming in the afternoon or tomorrow to plow us out.', '2020-12-18 00:00:00'),
(267, 68, 19, 12, 2020, 'Well they didn\'t come yesterday so we\'re hoping they actually show up today.  We still have my parents care in case of emergency.\n\nI quit smoking for about 3 weeks but fell off the wagon again.', '2020-12-19 00:00:00'),
(268, 68, 18, 12, 2020, 'I should mention we have a 740 foot driveway so it was quite the undertaking to get to the endof the driveway. She\'s a trooper!', '2020-12-18 00:00:00'),
(269, 68, 16, 12, 2020, 'Ian helped me load a bunch of wood into the house.  It\'s mostly pieces from the old deck so it\'s gonna burn really fast.', '2020-12-16 00:00:00'),
(270, 68, 19, 12, 2020, 'We\'re plowed out!.  We returned my mothers car and we\'re back amongst the world again. Got the cars all cleared off and some paths shoveled.  Next up log splitting and loading into the house. Woo hoo.', '2020-12-19 00:00:00'),
(271, 68, 19, 12, 2020, 'I\'ve been making progress on this site.  Doing a lot of work on the profiles pages.  I also completed the friend request section on the home page.  Next up will be the friends pages, then followers, and messages. The hard stuff is going to be the media I think.  I have two guys working on events and family tree.  They\'re using tools not meant for it specifically but I think they can make them work with some tweaks.  That takes a LOT off my plate.  I need to be able to post to things like events, work, etc which will be the last big lift.', '2020-12-19 00:00:00'),
(272, 68, 19, 12, 2020, 'Split some more wood.  I\'m exhausted. It sucks getting old.', '2020-12-19 00:00:00'),
(273, 68, 19, 12, 2020, 'The grandkids are coming over tomorrow.  That should be interesting.', '2020-12-19 00:00:00'),
(274, 68, 25, 12, 2020, 'We\'re all set for Christmas. Presents are all wrapped (thanks to Bron this year) and the grandparents are coming over for dinner.  Heather\'s boyfriend was exposed to someone who tested positive for covid so it\'s up in the air if we\'re going to let her come.', '2020-12-25 00:00:00'),
(275, 68, 29, 12, 2020, 'Heather\'s boyfriends roommate has covid so we\'re likely going to push the party back another week.\n\nMaking good progress on the app. Events is done and family tree is moving along. The friends pages(except search) are done and follower pages done too.\n\nThe bill for the chainsaw is over $300so that\'s gonna wait until I\'m paid again in a couple weeks.\n\nStill hobbling around, not much progress on that front unfortunately.', '2020-12-29 00:00:00'),
(276, 68, 2, 1, 2021, 'The diary entry was broken (again) for some reason.  I\'m making a lot of progress on this app and shooting to get it out there in the next few months.  The DOH application is coming along well too. \n\nI was able to get a $500+ refund from amazon on the erroneous route53 set up that never worked which is nice.  They charged me over $900 so I\'m trying to see why the refund is so low.\n\nI get paid this week so I\'ll pick up the chainsaw and get back to work next weekend on the trees. \n\nIan\'s been mostly gone the last couple of days hanging out with Miranda and her friends.  It\'s nice to see him getting out there and his attitude seems better towards himself which is nice.', '2021-01-02 00:00:00'),
(277, 68, 1, 1, 2021, 'It\'s funny, it\'s 2021 and yet it still feels the same ;). I\'ve been laughing for months as people looked forward to the new year like it was someone magically going to be better all of a sudden.', '2021-01-01 00:00:00'),
(278, 68, 4, 1, 2021, 'Got a refund from Amazon for erroneous route53 charges which is nice. It\'s a little over $900!\n\nHave to pick up the chainsaw this week and get back to work on the trees.', '2021-01-04 00:00:00'),
(279, 68, 3, 1, 2021, 'Wow, I\'m old.  I was only able to split three logs! They\'re really tough to split but man that\'s just a little pathetic.  Had a nice 3 day weekend, we I had more of them.', '2021-01-03 00:00:00'),
(280, 68, 7, 1, 2021, 'Making good progress on the family tree functionality!  Have to go back and look at posts for profiles and then think about posts related to interests. Still lots to do but it\'s getting there.', '2021-01-07 00:00:00'),
(281, 68, 8, 1, 2021, 'More family tree updates today.  Picked up the chainsaw and some birthday presents yesterday.\n\nThe ankle still hurts. It\'s painful to walk and I\'m looking forward to it getting better (someday)', '2021-01-08 00:00:00'),
(282, 68, 14, 1, 2021, 'Went in to the office yesterday and met with Michael to discuss the application.  That went well.  Didn\'t do much over the weekend except for Ian/Heather\'s birthday party which was nice.  Ian borrowed my car to run to the post office so we\'re getting close to him being a fee agent.', '2021-01-14 00:00:00'),
(283, 68, 8, 1, 2021, 'Ian took and passed his road test!  He\'s now a real adult ;)', '2021-01-08 00:00:00'),
(284, 68, 14, 1, 2021, 'Making more progress on the app.  Farmed out work on the family tree (again) and the posts.  Still have LOTS to do.', '2021-01-14 00:00:00'),
(285, 68, 15, 1, 2021, 'Ran into issues with the vendor who was working on the posts project so have to go out for bids again. \n\nIan wasn\'t able to get his insurance today so we weren\'t able to get his car on the road.', '2021-01-15 00:00:00'),
(286, 68, 17, 1, 2021, 'Got a lot of work done on category entry this weekend. Plan to finish it up today!  IT\'s coming along but there\'s still a LOT to do.', '2021-01-17 00:00:00'),
(287, 68, 20, 1, 2021, 'Nothing exciting has happened the last few days. Still making progress on the app.  I\'m about  60% through the required pages.', '2021-01-20 00:00:00'),
(288, 68, 20, 1, 2021, 'I think we\'re headed to DMV today to get Ian\'s car on the road.\n\nHe mentioned the other night that he\'s planning to go to HVCC and live off campus which was news to me.', '2021-01-20 00:00:00'),
(289, 68, 2, 2, 2021, 'I\'ve been remiss on entries again.  I\'ve been spending a lot of time working on this application.  I have 20 or so tasks left to go in phase 1 so it\'s getting pretty close to done.', '2021-02-02 00:00:00'),
(290, 68, 2, 2, 2021, 'Well, phase 1 done anyways. I have 25 or so tasks for phase 2 so far and there will be more.', '2021-02-02 00:00:00'),
(291, 68, 2, 2, 2021, 'Bron has been pretty much asleep since she got home from work around 5.  She said her neck hurt and her stomach didn\'t feel well.  :(', '2021-02-02 00:00:00');
