INSERT INTO `interests` (`id`, `userid`, `interest`, `description`, `startdate`, `enddate`) VALUES
(13, 68, 'Yankees Fan', 'I\'ve been a Yankees fan since the mid seventies. I\'ve taken all my children to multiple Yankees games over the years, something I\'m pretty happy about.', '1974-01-25', '0000-00-00'),
(14, 68, 'Bills Fan', 'I\'ve been a Bills fan  since the early 90s.  I lived through them losing four straight Superbowls and finally had an exciting year this year watching them play.', '1993-01-01', '0000-00-00'),
(15, 68, 'Computers', 'I got into computers when I was very young.  My cousins had an early TRS 80 computer that I just loved. My parents bought a Commodore 64 when I was in my early teens.  I later bought a Commodore 128 and then moved into IBM computers.  I loved programming and was self taught which I continue to do to this day.', '1978-01-01', '0000-00-00'),
(16, 68, 'Golf', 'I got into Golfing late in life.  My cousin David took me golfing when I was a teenager but I didn\'t get really into it until the mid nineties.I shoot in the nineties and probably go once or maybe twice a year but wish I could go more.  We have a tradition that I take Larry and the kids golfing once a year as his father\'s day present.', '1995-01-01', '0000-00-00'),
(17, 68, 'The 90\'s', 'The nineties was a great decade for me as a sports fan.  The Yankees, Bills, and Bulls were all teams I was following and they all had a great decade.  Never before or since was I a fan of so many winners.  It\'s been a tough couple decades since but I can always look back and marvel at how lucky I was.', '1990-01-01', '0000-00-00');
